import React from 'react';
import LottieView from 'lottie-react-native';

const LottieAnimation = () => {
    return (
        <View>
            <Text>Hello again</Text>
        <LottieView>
            source={require('./assets/kittenanimation.json')}
        </LottieView>
        </View>
    )
};

export default LottieAnimation;
